import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';
import Buy from './Components/Buy/Buy';

const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>,
    children: [
      {
        path: "/buy",
        element: <Buy/>
      },


    ],
  },
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
